import { BsFileCheck } from "react-icons/bs";

const Navbar = () => {
    return(
        <nav className='navbar under'>
            <a href='/'><BsHouseDoor/></a>
            <a href='/about-me'><BsPersonBoundingBox/></a>
            <a href='/about-me'><BsPersonBoundingBox/></a>
